import React from "react";
import { Segment, Grid, Divider } from "semantic-ui-react";

const styles = {
  image: {
    height: "25vh",
    width: "100vw"
  },
  container: {
    width: "100vw",
    heigh: "86vh"
  }
};

class About extends React.Component {
  render() {
    return (
      <Grid columns={2} relaxed="very" style={{ height: "25vh" }}>
        <Grid.Column verticalAlign="middle" textAlign="center">
          <h1> About Me </h1>
        </Grid.Column>
        <Divider vertical fitted />
        <Grid.Column verticalAlign="middle" textAlign="left" width={7}>
          <p>
            We can give your company superpowers to do things that they never
            thought possible. Let us delight your customers and empower your
            needs...through pure data analytics. Yes that's right, you thought
            it was the stuff of dreams, but even bananas can be bioengineered.{" "}
          </p>
        </Grid.Column>
      </Grid>
    );
  }
}

export default About;
